import React from 'react';
import Course from '../components/CourseDetails/Course/Course';
import Informationtecnology from '../components/CourseDetails/Information/Information';

const CourseDetails = () => {
  const styles = {
    backgroundColor: 'black',
  };

  return (
    <div className='a' style={styles}>
      <Course />
      <Informationtecnology />
    </div>
  );
};

export default CourseDetails;
